function App() {


return (
    <>


      <Provider store={store}>

        <Head />
        <Toaster
        position="bottom-center"
        toastOptions={{
          style: {
            background: "#EF4444",
            color: "#f7f7f7",
          },
        }}
      />
          <Outlet />

          <Footer />

        </Provider>


    </>
  );
}

